Este poema es un soneto satírico escrito por Manuel Bretón de los Herreros (1796-1873), dramaturgo, poeta y periodista español del Romanticismo. La composición es una burla hacia un poeta apellidado Brabo, jugando con la ambigüedad entre su apellido y el adjetivo "bravo" como exclamación de aprobación.
